import React, { useEffect } from 'react';
import styled, { keyframes } from 'styled-components';
import AOS from 'aos'; // AOS for scroll animations
import 'aos/dist/aos.css'; // AOS CSS import

const Home = () => {
  useEffect(() => {
    AOS.init({ duration: 1200 }); // Initialize AOS
  }, []);

  return (
    <Container>
      {/* Hero Section */}
      <Hero>
        <HeroContent data-aos="fade-up">
          <Title>Welcome to FitLife</Title>
          <Subtitle>Your Personal Fitness Companion</Subtitle>
          <Button>Get Started</Button>
        </HeroContent>
      </Hero>

      {/* Goals and Features Section */}
      <Section>
        <SectionTitle data-aos="fade-right">Why FitLife?</SectionTitle>
        <Features>
          <FeatureCard data-aos="zoom-in">
            <Icon>🔥</Icon>
            <FeatureTitle>Track Your Goals</FeatureTitle>
            <FeatureDescription>
              Set and monitor daily calorie intake, weight targets, and more to stay on track with your fitness journey.
            </FeatureDescription>
          </FeatureCard>
          <FeatureCard data-aos="zoom-in" data-aos-delay="200">
            <Icon>📊</Icon>
            <FeatureTitle>Personalized Insights</FeatureTitle>
            <FeatureDescription>
              Receive personalized insights based on your data to optimize your fitness and diet plans.
            </FeatureDescription>
          </FeatureCard>
          <FeatureCard data-aos="zoom-in" data-aos-delay="400">
            <Icon>🏆</Icon>
            <FeatureTitle>Achieve Your Goals</FeatureTitle>
            <FeatureDescription>
              With clear goal tracking and feedback, FitLife helps you reach your fitness milestones.
            </FeatureDescription>
          </FeatureCard>
        </Features>
      </Section>

      {/* Testimonials Section */}
      <Section>
        <SectionTitle data-aos="fade-right">What Our Users Say</SectionTitle>
        <Testimonials>
          <TestimonialCard data-aos="flip-left">
            <Quote>“FitLife has completely transformed the way I approach my fitness goals!”</Quote>
            <Author>- John D.</Author>
          </TestimonialCard>
          <TestimonialCard data-aos="flip-left" data-aos-delay="200">
            <Quote>“The personalized insights are a game-changer for my daily routine!”</Quote>
            <Author>- Sarah L.</Author>
          </TestimonialCard>
        </Testimonials>
      </Section>

      {/* Call to Action Section */}
      <CTASection data-aos="fade-up">
        <CTATitle>Ready to Start Your Fitness Journey?</CTATitle>
        <CTADescription>Join FitLife today and begin transforming your life!</CTADescription>
        <CTAButton>Join Now</CTAButton>
      </CTASection>
    </Container>
  );
};

export default Home;

// Styled Components and Animations
const fadeIn = keyframes`
  from { opacity: 0; transform: translateY(20px); }
  to { opacity: 1; transform: translateY(0); }
`;

const Container = styled.div`
  font-family: 'Arial', sans-serif;
  color: #333;
`;

const Hero = styled.section`
  background: linear-gradient(135deg, #ff416c, #ff4b2b);
  height: 80vh;
  display: flex;
  align-items: center;
  justify-content: center;
  position: relative;
  overflow: hidden;
  animation: ${fadeIn} 1s ease-in-out;
`;

const HeroContent = styled.div`
  text-align: center;
  color: white;
`;

const Title = styled.h1`
  font-size: 4rem;
  margin: 0;
`;

const Subtitle = styled.h2`
  font-size: 1.5rem;
  margin: 10px 0 20px;
`;

const Button = styled.button`
  background-color: white;
  color: #ff416c;
  border: none;
  padding: 10px 20px;
  border-radius: 25px;
  font-size: 1.2rem;
  cursor: pointer;
  transition: background-color 0.3s ease;

  &:hover {
    background-color: #ff4b2b;
    color: white;
  }
`;

const Section = styled.section`
  padding: 60px 20px;
  text-align: center;
  background-color: #f9f9f9;
`;

const SectionTitle = styled.h2`
  font-size: 2.5rem;
  margin-bottom: 20px;
`;

const Features = styled.div`
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
  gap: 20px;
`;

const FeatureCard = styled.div`
  background: white;
  border-radius: 10px;
  padding: 20px;
  width: 280px;
  box-shadow: 0 10px 20px rgba(0, 0, 0, 0.1);
  transition: transform 0.3s;

  &:hover {
    transform: scale(1.05);
  }
`;

const Icon = styled.div`
  font-size: 2.5rem;
  margin-bottom: 10px;
`;

const FeatureTitle = styled.h3`
  font-size: 1.5rem;
`;

const FeatureDescription = styled.p`
  font-size: 1rem;
`;

const Testimonials = styled.div`
  display: flex;
  justify-content: center;
  gap: 20px;
`;

const TestimonialCard = styled.div`
  background: white;
  border-radius: 10px;
  padding: 20px;
  width: 300px;
  box-shadow: 0 10px 20px rgba(0, 0, 0, 0.1);
`;

const Quote = styled.p`
  font-style: italic;
  font-size: 1rem;
`;

const Author = styled.p`
  text-align: right;
  font-weight: bold;
  margin-top: 10px;
`;

const CTASection = styled.section`
  background: linear-gradient(135deg, #ff4b2b, #ff416c);
  padding: 40px;
  text-align: center;
  color: white;
`;

const CTATitle = styled.h2`
  font-size: 2rem;
`;

const CTADescription = styled.p`
  margin: 10px 0 20px;
`;

const CTAButton = styled.button`
  background-color: white;
  color: #ff416c;
  border: none;
  padding: 10px 20px;
  border-radius: 25px;
  font-size: 1.2rem;
  cursor: pointer;
  transition: background-color 0.3s ease;

  &:hover {
    background-color: #ff4b2b;
    color: white;
  }
`;
